import React from "react";
import { Route, Link } from "react-router-dom";
import "./App.css";
import Actors from "./Actors";
import Ideas from "./Ideas";
import Notes from "./Notes";
import Home from "./Home";

function App() {
  return (
    <div>
      <nav>
        <Link to="/">Welcome Page</Link>
        <Link to="/ideas">Movie-Ideas</Link>
        <Link to="/ideas">Movie-Ideas</Link>
        <Link to="/notes">Movie-Notes</Link>
      </nav>
      <Route path="/" exact>
        <Home />
      </Route>
      <Route path="/actors">
        <Actors />
      </Route>
      <Route path="/ideas">
        <Ideas />
      </Route>
      <Route path="/notes">
        <Notes />
      </Route>
    </div>
  );
}

export default App;
